import React, {Component} from 'react';
import { Redirect } from 'react-router';
import store from "../../store";

class Recommend extends Component {
    constructor(props) {
        super(props);
        this.state = store.getState()
    }

    render() {
        if(this.state.isLogin) {
            return (
                <div>123</div>
            )
        }else{
            return (
                <Redirect to="/login" />
            )
        }
    }
}

export default Recommend
